import { Injectable } from '@angular/core';
import { HttpClient, HttpErrorResponse } from '@angular/common/http';
import { BehaviorSubject, catchError, map, Observable, throwError } from 'rxjs';
import { ConfigService } from './config-service.interface';
import { Configuration } from './config.interface';
import { Location } from '@angular/common';

@Injectable({
  providedIn: 'root',
})
export class JsonConfigService implements ConfigService {
  config!: Configuration;
  isLoaded$: BehaviorSubject<boolean> = new BehaviorSubject<boolean>(false);

  constructor(private readonly http: HttpClient) { }

  loadConfig(): Observable<void> {
    return this.http.get('assets/config.json')
      .pipe(map((data: any) => {
        this.config = data;
        this.isLoaded$.next(true);
      }), catchError((error: HttpErrorResponse) => {
        return throwError(() => error);
      }));
  }

  getEndpoint(controller: string, path: string): string {
    return Location.joinWithSlash(Location.joinWithSlash(this.config.baseUrl, controller), path);
  }
}

import { Injectable } from "@angular/core";
import { LogLevel, LoggingService } from "./logging-service.interface";
import { ConfigService } from '@app/core/services/config/config-service.interface';
import { filter } from "rxjs";

@Injectable()
export class LoggingFactory {

  constructor(
    private readonly configService: ConfigService,
    private loggingService: LoggingService
  ) { }

  create(scope: string): LoggingService {
    // some services are initialized before configService is loaded, set logLevel after configService is loaded
    // NOTE this could lead to some extra logs on all levels on application startup
    if (!this.configService.config?.logLevel) {
      this.configService.isLoaded$
        .pipe(filter((isLoaded: boolean) => isLoaded))
        .subscribe(() => this.loggingService.logLevel = (<any>LogLevel)[this.configService.config.logLevel]);
    } else {
      this.loggingService.logLevel = (<any>LogLevel)[this.configService.config.logLevel];
    }
    this.loggingService.scope = scope;
    return this.loggingService;
  }
}

import { Injectable } from '@angular/core';

export enum LogLevel {
  All = 0,
  Debug = 1,
  Info = 2,
  Warn = 3,
  Error = 4,
  Fatal = 5,
  Off = 6
}

@Injectable()
export abstract class LoggingService {
  abstract scope?: string;
  abstract logLevel: LogLevel;
  abstract debug(message: string, payload?: any): void;
  abstract info(message: string, payload?: any): void;
  abstract warn(message: string, payload?: any): void;
  abstract error(message: string, payload?: any): void;
  abstract fatal(message: string, payload?: any): void;
}

import { LumberjackService, LumberjackLevel, LumberjackTimeService, provideLumberjack } from '@ngworker/lumberjack';
import { Injectable } from '@angular/core';
import { LogLevel, LoggingService } from './logging-service.interface';

@Injectable()
export class LumberjackLoggingService implements LoggingService {
  constructor(
    private readonly lumberjackService: LumberjackService,
    private lumberjackTimeService: LumberjackTimeService
  ) { }

  scope?: string;
  logLevel: LogLevel = LogLevel.All;

  debug(message: string, payload?: any) {
    if (this.logLevel <= LogLevel.Debug)
      this.writeToLog(LogLevel.Debug, message, payload);
  }

  info(message: string, payload?: any) {
    if (this.logLevel <= LogLevel.Info)
      this.writeToLog(LogLevel.Info, message, payload);
  }

  warn(message: string, payload?: any) {
    if (this.logLevel <= LogLevel.Warn)
      this.writeToLog(LogLevel.Warn, message, payload);
  }

  error(message: string, payload?: any) {
    if (this.logLevel <= LogLevel.Error)
      this.writeToLog(LogLevel.Error, message, payload);
  }

  fatal(message: string, payload?: any) {
    if (this.logLevel <= LogLevel.Fatal)
      this.writeToLog(LogLevel.Fatal, message, payload);
  }

  private writeToLog(logLevel: LogLevel, message: string, payload?: any) {
    let lumberjackLevel: LumberjackLevel = LumberjackLevel.Debug;
    switch (logLevel) {
      case LogLevel.Debug:
        lumberjackLevel = LumberjackLevel.Debug;
        break;
      case LogLevel.Info:
        lumberjackLevel = LumberjackLevel.Info;
        break;
      case LogLevel.Warn:
        lumberjackLevel = LumberjackLevel.Warning;
        break;
      case LogLevel.Error:
        lumberjackLevel = LumberjackLevel.Error;
        break;
      case LogLevel.Fatal, LogLevel.Off:
        lumberjackLevel = LumberjackLevel.Critical;
        break;
    }

    this.lumberjackService.log({
      level: lumberjackLevel,
      message: message,
      payload: payload,
      scope: this.scope,
      createdAt: this.lumberjackTimeService.getUnixEpochTicks(),
    });
  }
}

